import React, { useState } from 'react';
// import MultiSelect from 'components/common/input/selects/multiSelect';
import { FILTER_LABELS, ALL_ACTION_FIGURE_ATTRIBUTES } from 'shared/constants/stringConstantsSelectors';
import { SingleSelect } from 'components/common/input/selects/singleSelect';
import * as DOMAIN from 'shared/constants/domainConstantSelectors';
import TextField from 'components/common/input/textFields/textFields';

export const AddNewActionFigureForm = props => {
    const [productLine, setProductLine] = useState();
    const [name, setName] = useState();
    const [additionalNameDetails, setAdditionalNameDetails] = useState();
    const [assortment, setAssortment] = useState();
    const [group, setGroup] = useState();
    const [seriesNumber, setSeriesNumber] = useState();
    const [versions, setVersions] = useState();
    const [imageURL, setImageURL] = useState();
    const [nib, setNib] = useState();
    const [openComplete, setOpenComplete] = useState();
    const [openIncomplete, setIpenIncomplete] = useState();

    const handleProductLineChange = event => { setProductLine(event.target.value); };
    const handleNameChange = event => { setName(event.target.value); };
    const handleAdditionalNameDetailsChange = event => { setAdditionalNameDetails(event.target.value); };
    const handleAssortmentChange = event => { setAssortment(event.target.value); };
    const handleGroupChange = event => { setGroup(event.target.value); };
    const handleSeriesNumberChange = event => { setSeriesNumber(event.target.value); };
    const handleVersionsChange = event => { setVersions(event.target.value); };
    const handleImageURLChange = event => { setImageURL(event.target.value); };
    const handleNIBChange = event => { setNib(event.target.value); };
    const handleOpenCompleteChange = event => { setOpenComplete(event.target.value); };
    const handleOpenIncompleteChange = event => { setIpenIncomplete(event.target.value); };

    productLine && console.log(`productLine: ${productLine}`,);
    name && console.log(`name: ${name}`,);
    additionalNameDetails && console.log(`additionalNameDetails: ${additionalNameDetails}`,);
    assortment && console.log(`assortment: ${assortment}`,);
    group && console.log(`prodgroupuctLine: ${group}`,);
    seriesNumber && console.log(`seriesNumber: ${seriesNumber}`,);
    versions && console.log(`versions: ${versions}`,);
    nib && console.log(`nib: ${nib}`,);
    openComplete && console.log(`openComplete: ${openComplete}`,);
    openIncomplete && console.log(`openIncomplete: ${openIncomplete}`,);

    return (
        <>
            <SingleSelect 
                handleFilterChange={handleProductLineChange} 
                inputLabel={FILTER_LABELS.PRODUCT_LINES}
                menuItems={DOMAIN.PRODUCT_LINES}
            />
            <TextField inputLabel={ALL_ACTION_FIGURE_ATTRIBUTES.NAME} handleChange={handleNameChange}/>
        </>
    );
};
